void SensorAsyncWaiter::GetDefaultConfiguration(::device::PlatformSensorConfiguration* out_configuration)
{
    base::RunLoop loop;
    proxy_->GetDefaultConfiguration(base::BindOnce(
        [](base::RunLoop* loop, ::device::PlatformSensorConfiguration* out_configuration, const ::device::PlatformSensorConfiguration& configuration) {
            *out_configuration = std::move(configuration);
            loop->Quit();
        },
        &loop, out_configuration));
    loop.Run();
}

